    <h3 {...{
      "id": "结合弹窗"
    }}>{`结合弹窗`}</h3>
    <p>{`设置了一个源数据，对于源数据，使用弹窗的方式进行新增、修改、查看。`}</p>
    <ul>
      <li parentName="ul">{`新增时，表单组件无默认数据`}</li>
      <li parentName="ul">{`编辑时，表单组件有默认数据`}</li>
    </ul>
    <p>{`此示例展示了EditForm如何结合弹窗使用，组件库提供了一个现成的组件`}<inlineCode parentName="p">{`EditModal`}</inlineCode>{`。
如需更复杂的弹窗功能，建议在项目中自定义一个类似EditModal的组件，在项目各模块使用。`}</p>
    <Playground __position={5} __code={'class Demo extends React.Component {\n    constructor(props) {\n      super(props)\n      this.formItemList = [\n        {\n          name: \'nickName\',\n          label: \'姓名\',\n          content: <Input />,\n          rules: [\n            {\n              required: true,\n              message: \'请填写姓名\',\n            },\n          ],\n        },\n        {\n          name: \'age\',\n          label: \'年龄\',\n          content: <InputNumber />,\n        },\n      ]\n      this.state = {\n        visibleModal: false,\n        source: {\n          id: 1,\n          nickName: \'aaaa\',\n          age: 45,\n        },\n        editSource: null,\n        addFunction: null,\n        updateFunction: null,\n      }\n    }\n    addFunction(value) {\n      Modal.confirm({\n        title: \'新增\',\n        content: JSON.stringify(value),\n      })\n      return fetch(\'./add\')\n    }\n\n    updateFunction(value) {\n      Modal.confirm({\n        title: \'新增\',\n        content: JSON.stringify(value),\n      })\n      return fetch(\'./update\')\n    }\n\n    closeEdit() {\n      this.setState({ visibleModal: false })\n    }\n\n    render() {\n      const {\n        visibleModal,\n        editSource,\n        updateFunction,\n        addFunction,\n        source,\n      } = this.state\n      return (\n        <div>\n          <div>\n            <Button\n              style={{ marginRight: 10 }}\n              onClick={() => {\n                this.setState({\n                  visibleModal: true,\n                  addFunction: this.addFunction,\n                  updateFunction: this.updateFunction,\n                  editSource: null,\n                })\n              }}\n            >\n              新增\n            </Button>\n            <Button\n              style={{ marginRight: 10 }}\n              onClick={() => {\n                this.setState({\n                  visibleModal: true,\n                  addFunction: this.addFunction,\n                  updateFunction: this.updateFunction,\n                  editSource: source,\n                })\n              }}\n            >\n              编辑\n            </Button>\n            <Button\n              onClick={() => {\n                this.setState({\n                  visibleModal: true,\n                  addFunction: this.addFunction,\n                  updateFunction: null,\n                  editSource: source,\n                })\n              }}\n            >\n              查看\n            </Button>\n          </div>\n          <Modal\n            visible={visibleModal}\n            footer={null}\n            title={editSource ? editSource.nickName : \'新增\'}\n            onCancel={this.closeEdit.bind(this)}\n            destroyOnClose\n          >\n            <EditForm\n              onCancel={this.closeEdit.bind(this)}\n              formItemList={this.formItemList}\n              addFunction={addFunction}\n              updateFunction={updateFunction}\n              source={editSource}\n              onOk={() => {\n                this.closeEdit()\n              }}\n            />\n          </Modal>\n        </div>\n      )\n    }\n  }'} __scope={{
